import { Title, getStart } from "./Title";
import GameBoard from "./GameBoard";
import "./App.css";

const App = () => {
  if (getStart()) {
    return <GameBoard />;
  } else {
    return <Title />;
  }
};

const StartScreen = () => {
  return <Title />;
}

export default App;
